                                    imageUrl: personalBooksToSearch.image,
                                    offerExchangesFunc: null,
                                    offerExchangesFuncParams: null,
                                    enableBookToExchangesFunc: null,
                                    enableBookToExchangesFuncParams: null,
                                    excludeBookFunc: null,
                                    excludeBookFuncParams: null,
                                    isBookEnableToExchanges: false,
